import React from 'react';
import ReactDOM from "react-dom";

const f ="yes we can";

const m ="https://picsum.photos/200/300";
const n ="https://picsum.photos/200/300";
const b ="https://picsum.photos/200/300";

ReactDOM.render(
<>
<h1 contentEditable>this is a page of react</h1>
<img src={m} alt="notshowm" />
<img src={n} alt="notshowm" />
<img src={b} alt="notshowm" />
<p>{`i am ${f} `}</p>
</>,
document.getElementById("root")
);
